                <div className="card bg-light mb-3">
                    <div className="card-header">
                        <TasksHeader/>
                    </div>
                    <div className="card-body">
                        <TasksList/>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default TasksContainer
